import React from 'react'
import { BsArrowLeftCircle, BsArrowRightCircle } from "react-icons/bs";

import {data} from "../assets/data"
export const CarouselAsos = () => {
    
        
        
    
  return (
    <div className='overflow-hidden max-w-[1400px] h-[780px] m-auto py-16 px-4 relative'>
        <div className=''>
            {data.map((s)=>{
                return (
                    <img src={s.imgUrl} alt="" />
                )
            })}

        </div>
        <div>
            <button>
                <BsArrowLeftCircle/>
            </button>
            <button>
                <BsArrowRightCircle/>
            </button>
        </div>

    </div>
  )
};
